import { useNavigate } from "react-router-dom";

const ChallengeItem = ({ id2, Challenge_name, Challenge_mode }) => {
  const navigate = useNavigate();
  const goDetail_ch = () => {
    navigate(`/Challenge/${id2}`);
  };
  return (
    <div className="ChallengeItem" onClick={goDetail_ch}>
      <div>
        <img
          src={process.env.PUBLIC_URL + `assets/${Challenge_picture}.jpeg`}
        />
      </div>
      <div>커뮤니티 이름 : {Challenge_name}</div>
      <div>커뮤니티 결제 허용 : {Challenge_allow}</div>
    </div>
  );
};

export default ChallengeItem;
